import React, { Component } from 'react'
// import picture1 from '../../pictures/logo.png'
import picture1 from '../../pictures/logo.png'

export default class Title extends Component {
    render() {
        return (
            <div className='icon'>
                <img src={picture1} alt="图片url失效"></img>
            </div>
        )
    }
}
